-- solution for
-- http://adventofcode.com/2018/day/4


module Main where

import           Control.Arrow(second, (***))
import           Util.Main1 (main12)
import           Data.List  (sort, foldl1')
import qualified Data.Monoid.IntMap as M
import           Data.Monoid
import           Data.Tuple (swap)
import           Text.Megaparsec
import           Text.Megaparsec.Char

-- ----------------------------------------

main :: IO ()
main = do
  main12 "2018-04"
    inp captcha1
    inp captcha2

captcha1 :: String -> String
captcha1 = show . solve1 . fromString

captcha2 :: String -> String
captcha2 =  show . solve2 . fromString

solve1 :: [LogGuard] -> Int
solve1 ls =
  sleepyGuard * sleepyTime
  where
    sleepyGuard = fst . findIxMax $ sTimes
    sleepyTimes = maybe mempty id . M.lookup sleepyGuard $ sMap
    sleepyTime  = fst . findIxMax $ sleepyTimes

    sMap        = toGuardsMin . toGMins $ ls
    sTimes      = fmap (foldMap id) sMap

solve2 :: [LogGuard] -> Int
solve2 ls =
  guard * time
  where
    (guard, (time, _num)) =
      findGuardMax . fmap findIxMax . toGuardsMin . toGMins $ ls

findIxMax :: Minutes -> (Int, Count)
findIxMax = fromKV . mconcat . map toKV . M.toList

findGuardMax :: M.IntMap (Int, Count) -> (Int, (Int, Count))
findGuardMax = foldl1' maxG . M.toList
  where
    maxG x0@(_g0, (_tn, n0)) x1@(_g1, (t1, n1))
      | n0 < n1   = x1
      | otherwise = x0

-- ----------------------------------------

type Count     = Sum Int
type Minutes   = M.IntMap Count
type GuardsMin = M.IntMap Minutes

type LogGMin   = (Guard, Minutes)
type LogGuard  = (Guard, [(Time, Time)])
type LogEntry  = (DayTime, Act)
type DayTime   = (Day, Time)
type Day       = Int
type Time      = Int
type Guard     = Int

data Act       = Shift Guard | Asleep | Wakeup
                 deriving (Eq, Ord, Show)

data KV a      = KV  !Int !a
                 deriving Show

instance Ord a => Semigroup (KV a) where
  p1@(KV _k1 v1) <> p2@(KV _k2 v2)
    | v1 >= v2  = p1
    | otherwise = p2

instance (Num a, Ord a) => Monoid (KV a) where
  mempty = KV 0 (fromInteger 0)

fromKV :: KV a -> (Int, a)
fromKV (KV k v) = (k, v)

toKV :: (Int, a) -> KV a
toKV (k, v) = KV k v

-- ----------------------------------------

toGuardsMin :: [LogGMin] -> GuardsMin
toGuardsMin = M.fromList

toGMins :: [LogGuard] -> [LogGMin]
toGMins = map (second $ foldMap toM)
  where
    toM :: (Time, Time) -> Minutes
    toM (sleep, awake) = M.fromList
      [(i, Sum 1) | i <-  [sleep .. awake -1]]

type SP = Parsec () String

fromString :: String -> [LogGuard]
fromString = parse . unlines . sort . lines
  where
    parse :: String -> [LogGuard]
    parse s = do
      maybe (error "no parse") id $
        parseMaybe pLogGs s

    pLogGs :: SP [LogGuard]
    pLogGs = many pLogG

    pLogG :: SP LogGuard
    pLogG = do
      (_dt, Shift g) <- pLog pShift
      sleped <- many pSleepWake
      return (g, sleped)

    pSleepWake :: SP (Time, Time)
    pSleepWake = try $ do
      ((_d1, t1), Asleep) <- pLog pAsleep
      ((_d2, t2), Wakeup) <- pLog pWakeup
      return (t1, t2)

--  pLogs :: SP [LogEntry]
--  pLogs = many (pLog pAct)

    pLog :: SP Act -> SP LogEntry
    pLog pAct = (,) <$> (pDayTime <* space) <*> pAct <* space <* optional newline

    pDayTime :: SP DayTime
    pDayTime = (,) <$> (char '[' *> pDay) <*> (space *> pTime <* char ']')

    pDay :: SP Day
    pDay = toDay <$> (pNum <* char '-') <*> (pNum <* char '-') <*> pNum
      where
        toDay y m d = (y * 100 + m) * 100 + d

    pTime :: SP Time
    pTime = toTime <$> (pNum <* char ':') <*> pNum
      where
        toTime m s = m * 60 + s

    pAct :: SP Act
    pAct = pShift <|> pAsleep <|> pWakeup

    pShift, pAsleep, pWakeup :: SP Act
    pShift  = try $ Shift <$> (string "Guard #" *> pNum <* string " begins shift")
    pAsleep = try $ (string "falls asleep" *> pure Asleep)
    pWakeup = try $ (string "wakes up" *> pure Wakeup)

    pNum :: SP Int
    pNum = read <$> some digitChar

